function GetIMDBImage(method,link,des){
	try {
		GM_xmlhttpRequest({
			method: method,
			url: link,
			overrideMimeType: 'text/plain; charset=x-user-defined',
			onload: function(response) {
				if(response.status == "200"){
					var img = "data:image/jpeg;base64," +  encode64(response.responseText);
					$(des).attr("src",img);
				}
			}
		});
	}catch(err) {
		console.log(err);
	}  
}
