function removeCovers(){
	$('img:not(.imdbCover)').each(function(){
		var h = $(this).height(),w = $(this).width();
		if(h > w && h >=120){
			var p,d;
			d = h - w;
			p = d / (w / 100);
			if (p >= 34 && p <=50){
				$(this).before("<div id='coverRemoved' style='background-color:red;color:white;border:1px solid black;'>This image is delete! Dimension of " + w + "x" + h + "</br>Width is " + p + "% larger then height.</br>" + $(this).attr("src") + "</div>");
				$(this).hide();
			}
		}
	});
}
function encode64(inputStr) {
	var b64 = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/=",
		outputStr = "",
		i = 0;

	while (i<inputStr.length){
		//all three "& 0xff" added below are there to fix a known bug
		//with bytes returned by xhr.responseText
		var byte1 = inputStr.charCodeAt(i++) & 0xff,
			byte2 = inputStr.charCodeAt(i++) & 0xff,
			byte3 = inputStr.charCodeAt(i++) & 0xff,

			enc1 = byte1 >> 2,
			enc2 = ((byte1 & 3) << 4) | (byte2 >> 4),
			enc3, enc4;

		if (isNaN(byte2)){
			enc3 = enc4 = 64;
		}else{
			enc3 = ((byte2 & 15) << 2) | (byte3 >> 6);
			if (isNaN(byte3)){
				enc4 = 64;
			}else{
				enc4 = byte3 & 63;
			}
		}
		outputStr +=  b64.charAt(enc1) + b64.charAt(enc2) + b64.charAt(enc3) + b64.charAt(enc4);
	}
	return outputStr;
}